import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

import './App.scss';



import Header from './Header';
import Recrutement from './Recrutement';

const useStyles = makeStyles((theme) => ({
    formControl: {
      margin: theme.spacing(1),
      minWidth: 200,
    },
    selectEmpty: {
      marginTop: theme.spacing(2),
    },
  }));

class Gestion extends Component {
    render() {
        return (
            <div className="gestion-button-container">
                <Button className="gerer-demandes" variant="contained" color="default">Gérer les demandes</Button>
                <Button className="gerer-demandes" variant="contained" color="default">Demandes traitées</Button>
                
            </div>
            
        )
    }
}

  
 function Choix() {
    const classes = useStyles();
    const [age, setAge] = React.useState('');
  
    const handleChange = (event) => {
      setAge(event.target.value);
    };
  
    return (
      <div className="gestion-demande-container">
        <div className="type-demande">
        <FormControl className={classes.formControl}>
          <InputLabel id="demo-simple-select-label">Type de demande</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            onChange={handleChange}
            autoWidth="true"
          >
            <MenuItem value={10}>Carte nationale d'identité</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
        </div>
        <div className="date"><TextField id="standard-basic" label="Date" /></div>

      </div>
    );
  }

class PageDemandes extends Component {
  render() {
    return (    
    <div>
      <Header />
      <hr className="overall-separator" />
      <Gestion />
      <Choix />
      <Recrutement />
      <br></br>
      <div className="end">
        <center>Copyright <span>&#169;</span> 2021 tous les droits résérvés.</center>
      </div>

    </div>
    );
  }

}
export default PageDemandes;
